import React from "react";

function PostDelete({post, deletePost}) {
    return (
    <div className="post-list">
        <li>
            <p>{post}</p>
        <button name="delete" onClick={deletePost}>Delete</button>
        </li>
    </div>
    )
}

export default PostDelete;
